/* eslint-disable import/no-anonymous-default-export */
import axios from "axios";


export default {
    search: function(query) {
        let q = (query).split("_").join("+");
        return axios.get(`https://www.googleapis.com/books/v1/volumes?q=${query}&maxResults=10`)
    }
};
